        public int[] MyMethodRecursive(int[] arr)
        {
            var distances = new int[arr.Length - 1];
            var capital = -1;
            var graph = new HashSet<int>[arr.Length];

            for (int i = 0; i < arr.Length; i++)
            {
                if (graph[arr[i]] == null)
                    graph[arr[i]] = new HashSet<int>();
                if (arr[i] == i)
                    capital = i;
                else                 
                    graph[arr[i]].Add(i);
            }

            AddUpCount(distances, graph, capital);

            return distances;
        }

        private void AddUpCount(int[] distances, HashSet<int>[] graph, int currentCity, int currentDistanceIndex = 0)
        {
            if (graph[currentCity] == null)
                return;
            foreach (var item in graph[currentCity])
            {
                distances[currentDistanceIndex]++;
                AddUpCount(distances, graph, item, currentDistanceIndex + 1);
            }
        }
        public int[] MyMethodQueue(int[] arr)  //Best solution
        {
            var distances = new int[arr.Length - 1];
            var capital = -1;
            var graph = new HashSet<int>[arr.Length];

            for (int i = 0; i < arr.Length; i++)
            {
                if (graph[arr[i]] == null)
                    graph[arr[i]] = new HashSet<int>();
                if (arr[i] == i)
                    capital = i;
                else
                    graph[arr[i]].Add(i);
            }

            var queue = new Queue<Tuple<int, int>>();

            foreach (var city in graph[capital])
            {
                queue.Enqueue(new Tuple<int, int>(city, 0));
            }

            while (queue.Count > 0)
            {
                var currentCityTuple = queue.Dequeue();
                distances[currentCityTuple.Item2]++;
                if (graph[currentCityTuple.Item1] == null)
                    continue;
                foreach (var city in graph[currentCityTuple.Item1])
                    queue.Enqueue(new Tuple<int, int>(city, currentCityTuple.Item2 + 1));
            }

            return distances;
        }
        public int[] MyMethodStack(int[] arr)  //Best solution
        {
            var distances = new int[arr.Length - 1];
            var capital = -1;
            var graph = new HashSet<int>[arr.Length];

            for (int i = 0; i < arr.Length; i++)
            {
                if (graph[arr[i]] == null)
                    graph[arr[i]] = new HashSet<int>();
                if (arr[i] == i)
                    capital = i;
                else
                    graph[arr[i]].Add(i);
            }

            var stack = new Stack<Tuple<int, int>>();
            
            foreach (var city in graph[capital])
            {
                stack.Push(new Tuple<int, int>(city, 0));
            }

            while (stack.Count > 0)
            {
                var currentCityTuple = stack.Pop();
                distances[currentCityTuple.Item2]++;
                if (graph[currentCityTuple.Item1] == null)
                    continue;
                foreach (var city in graph[currentCityTuple.Item1])
                    stack.Push(new Tuple<int, int>(city, currentCityTuple.Item2 + 1));
            }

            return distances;
        }

        public int[] MyMethodSlow(int[] arr)
        {
            var distances = new int[arr.Length - 1];
            var currentCities = new HashSet<int>();
            var nextCities = new HashSet<int>();

            for (int i = 0; i < arr.Length; i++)
            {
                if (i == arr[i])
                {
                    currentCities.Add(i);
                    break;
                }
            }

            for (int currentDistanceIndex = 0; currentDistanceIndex < distances.Length; currentDistanceIndex++)
            {
                for (int i = 0; i < arr.Length; i++)
                {
                    if (currentCities.Contains(arr[i]) && arr[i] != i)
                    {
                        distances[currentDistanceIndex]++;
                        nextCities.Add(i);
                    }
                }

                currentCities = new HashSet<int>(nextCities);
                nextCities.Clear();
            }

            return distances;
        }
    }

